import * as PropTypes from "prop-types";
import {Logo} from "../../components/logo/Logo";
import {LoginIllustration} from "../../components/illustrations/LoginIllustration";

function AuthLayout({title, children}) {
    return <div className="w-full h-screen flex flex-row gap-12 p-4">
        <div className="flex flex-col w-full">
            <Logo />

            <div className="p-8">
                {children}
            </div>
        </div>
        <div className="flex flex-col justify-center items-center gap-4 rounded-2xl bg-purple-500 w-full">
            <LoginIllustration />

            <h1 className="text-white font-bold text-4xl">{title}</h1>
        </div>
    </div>
}

AuthLayout.propTypes = {
    title: PropTypes.string,
    children: PropTypes.node
};

function LoginForm() {
    return null;
}

export function LoginPage() {
    return <AuthLayout title="Sign in to DineEase">
        <LoginForm />
    </AuthLayout>;
}
